import React from "react";
import "./page.css"

class Page extends React.Component {
    constructor(props, color) {
        super(props)
        this.state = {
            pos: 0
        }
        this.style_set = "background-color: " + color
    }

    render() {
        return (
            <div className="page-app" style={color}>
            </div>
        );
    }
}

export default Page
